css:
.test-status-output .message {
  max-height: 150px;
  overflow-y: scroll;
}
.test-status-output pre {
  background: #161719;
  color: #fff;
  font-size: 10px;
}
.test-status.pending {
  color: #ff982d;
}
.test-status.success {
  color: #529b2f;
}
.test-status.fail {
  color: #cc0000;
}
.test-status .icon:before {
  font-size: 14px;
  width: 14px;
  height: 14px;
  position: relative;
  top: 1px;
  margin-right: 0px;
}
